import React, {Component} from 'react';
import {Link} from "@reach/router";

class Artwalk extends Component {
    render() {
        const artwalk = this.props.artwalk.map(artwalk =>
            <li key={artwalk._id}>
                <>{artwalk.bilds}</>
            </li>
        );
        return (
            <>
                <h1>Artwalks</h1>
                <ol>
                    {artwalk}
                </ol>
                <Link to="/">Back</Link>
            </>

        );
    }

}     

export default Artwalk;
